import React from "react";
import "../../../Styles/Pages/AllProducts/ProductsContainer.scss";
import { products, productRow2 } from "../Shop/shopProducts";
import ProductCard from "../../Shared/ProductCard";

function ProductsContainer() {
  return (
    <div className='productsContainer'>
      <div className='productsContainer__row'>
        {products.map((product, key) => {
          return (
            <ProductCard
              displayAction={product.displayAction}
              action={product.action}
              img={product.img}
              title={product.title}
              description={product.description}
              price={product.price}
              key={key}
            />
          );
        })}
      </div>
      <div className='productsContainer__row'>
        {productsRow2.map((product, key) => {
          return (
            <ProductCard
              displayAction={product.displayAction}
              action={product.action}
              img={product.img}
              title={product.title}
              description={product.description}
              price={product.price}
              key={key}
            />
          );
        })}
      </div>
    </div>
  );
}

export default ProductsContainer;
